import React from 'react';

const Card = (props) => {
	return (
		<div class='bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
		   <img alt='robots' src='https://robohash.org/{this.props.id}?200x200'/>
		    <div>
		   	  <h2>{this.props.name}</h2>
		   	  <p>(this.props.email}</p>
		   	</div>
		</div>     	   
		);
}

export default Card;
